const initialState = {
    inputType : 1,
    inputText : "HelloWorld"
}

const reducer = (state = initialState, action) => {
    if(action.type === 'SET_INPUT'){
        const newState = Object.assign([],state);
        newState.inputType = action.payload.inputType;
        return newState;
    }
    return state;
}

export default reducer
